import { manufacturesList } from "../../data/manufacturesList"
import { createUseStyles } from "react-jss";
import { colors } from "../../style/globalStyle";

const Manufactures = () => {

    const styles = createUseStyles({
    });

    const classes = styles()


    return (
        <section className="manufactures">
            <div className="products-title-wrapper">
                <h2 className="products-title">Популярные производители:</h2>
                <a className="products-title-link" href="link">Все производители</a>
            </div>
            <ul className="manufactures-list">
                {manufacturesList.map((item) => (
                    <li className="manufactures-list-item" key={item.key}>
                        <a href={item.href}><img src={item.src} alt={item.alt} /></a>
                    </li>
                ))}
            </ul>
        </section>
    )
}

export default Manufactures
